UPDATE `quest_template` SET `QuestDescription`='The Emerald Dream suffers at the forces of the Incarnate Fyrakk. In its turmoil, some of its seeds have trouble taking root. \n\nIn exploring the Dream, I am certain you shall collect some special seeds. Plant them in soil and nourish them into a bloom, and I hear they will share bountiful gifts with you.\n\nGo forth and help life blossom in the Emerald Dream!', `VerifiedBuild`=53007 WHERE `ID`=78447; -- Aiding the Accord: Emerald Bounty
UPDATE `quest_template` SET `QuestDescription`='So much change to that which should be unchanging... \n\nRarely has the Dream seen such turmoil. It is meant to be a place of peace. Of life. \n\nChampion, we need all the help we can get. I bid you go forth and bring aid to the expanse of the Dream.\n\nI have no doubt the Dream will share its plenty with you in return.', `VerifiedBuild`=53007 WHERE `ID`=78444; -- A Worthy Ally: Dream Wardens
