UPDATE `quest_template` SET `QuestDescription`='It\'s all making sense now. I believe the missing dream spirit bonded with her--like Cyanthesa said.\n\nIt\'s making Shandris relive traumatic moments from her life. \n\nIt\'s not malicious, but the spirit and Shandris are feeding off each others\' fears. We have to bring her back to the camp. Shae\'lune might be able to help her.\n\nTalk to her. I look like the enemy right now. But maybe she\'ll talk to you.', `VerifiedBuild`=53007 WHERE `ID`=77674; -- Wounds of the Past
UPDATE `quest_template` SET `QuestDescription`='I haven\'t worked with Shandris long, but... it\'s unusual for her to act like that.\n\nBut it doesn\'t matter.\n\nWhile she deals with logistics, you and I should go ahead and find a way to cleanse these stones.\n\nMaybe Shae\'lune knows what to do next.', `QuestCompletionLog`='Meet Lilian back at the Haven Cascades camp.', `VerifiedBuild`=53007 WHERE `ID`=77665; -- Bound to You
UPDATE `quest_template` SET `Flags`=37748744, `QuestDescription`='Dear $p,\n\nIt seems wrong to say this of someone as mighty as Tyr, but I am worried about him. When he arrived at Tyr\'s Rest, he spent many days talking with us. We all asked him many questions, learning about the titans, ancient history, and his philosophy.\n\nBut recently, Tyr has been speaking less, and the answers he does give are shorter and some have an edge to them.\n\nI\'m not sure what\'s wrong, but something is different. Will you come speak with him?\n\nFor Tyr,\nValunei', `VerifiedBuild`=53007 WHERE `ID`=77341; -- Logotyrapy
