UPDATE `quest_template` SET `QuestDescription`='Greetings friend!\n\nI\'ve been looking for a good place to set up fishing nets around here, but it seems like the population of waddlers around here is too dense - they\'re eating away most of the juvenile fish before they get a chance to mature.\n\nI\'ve made some effigies to scare at least some of those ravenous birds away. This will help us sustain the abundance of fish across the Dragonsprings. \n\nCan you help me set those up?', `VerifiedBuild`=53007 WHERE `ID`=71192; -- Predator Control
UPDATE `quest_template` SET `QuestDescription`='As you may know, the children of Iskaara are fiercely independent. They learn from a young age to fend for themselves.\n\nIt\'s a rite of passage for many of the older kids to sneak off to the iceberg southeast of here. Kiopo, the eldest of our children, is out there right now. Tell him I sent you, and he should offer you one of our sleds!\n\nAh, that reminds me of my younger days... out there with my friends...', `VerifiedBuild`=53007 WHERE `ID`=70976; -- Slacking and Sledding
UPDATE `quest_template` SET `LogDescription`='Craft $1oa Dragon\'s Alchemical Solution using the Reclaim Concoctions recipe for Conflago in Valdrakken.', `VerifiedBuild`=53007 WHERE `ID`=70530; -- Examination Week
UPDATE `quest_template` SET `QuestDescription`='I\'ve been tending to this garden for years, preparing for the day I\'d finally accept my Lifecalling. Now that day is here!\n\nI love flowers and all trees and plants--even the bugs that live amongst them. I can feel nature\'s spirit--the Great Dragon Spirit--when I tend the garden.\n\nThere\'s only one thing left to do. I\'m going to invoke the Great Dragon Spirit, just like the legends.\n\n<Akora smiles brightly.>\n\nMeet me down in the garden by the pool where her bones rest. I\'ll explain more there.', `VerifiedBuild`=53007 WHERE `ID`=70351; -- Garden Party
UPDATE `quest_template` SET `QuestDescription`='Wisdom is not gained. It is earned. If you wish to prove yourself worthy, you will do so in the manner of my people: learning as we act.\n\nFind and hunt Thousandmile, the Elderbull, he who has escaped the hunt for generations.\n\nFrom this, you will gain the wisdom you seek.', `VerifiedBuild`=53007 WHERE `ID`=69979; -- A Worthy Hunt
UPDATE `quest_template` SET `QuestDescription`='We\'re changing the roster at the last minute. Some Primalist bigwig wants to join in on the competition to face you. And I\'m not saying no to an angry elemental dragon.\n \nI\'m sure you\'ll be fine. If not, then... well, you signed the waiver, right?', `VerifiedBuild`=53007 WHERE `ID`=66463; -- The Field of Ferocity: Elemental Revenge Round!
UPDATE `quest_template` SET `QuestDescription`='Heroes of the Horde, I bring news. The Dragon Isles are awakening!\n\nThe Isles went dormant in the wake of the Sundering. But now, at long last, they have called my kin and me  home.\n\nWhile the Isles hold many wonders, it is also a perilous land. We will require the aid of our mortal allies to reclaim our legacy.\n\nI am about to present the Aspects\' invitation to the Horde Council in Orgrimmar. Meet me there and we shall see what they have to say.', `VerifiedBuild`=53007 WHERE `ID`=65435; -- The Dragon Isles Await
